import Link from "next/link";

const index = () => {
    return (
        <div>
            <h1>The Main Page</h1>
            <p>
                Go to{" "}
                <Link href="/auth">
                    <a>Auth</a>
                </Link>{" "}
        Page
      </p>
        </div>
    );
};
export default index;
